        res.send(response)
    } catch (err) {
        res.json({ message: err })
    }
})

router.delete('/:id', isAuth, isAdmin, async (req, res) => {
    try {
        const response = await Speakers.deleteOne({ _id: req.params.id })
        res.json('Remove Success')
    } catch (err) {
        res.json({ message: err })
    }
})

export default router;

